import './vendors/bootstrap/bootstrap.min.css';

import HelloWorld from "./components/a6/HelloWorld.js";
import Practice from "./components/a6/Practice.js";
import Build from "./components/a6/Build.js";

function App() {
    return (
        <div className="container">
            <HelloWorld/>
            <Practice/>
            <Build/>
        </div>
    );
}
export default App;
